// CustomHeader.js
import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const CustomHeader = () => {
  return (

    <View style={styles.header}>
      <Image
        source={require('../assets/logo.svg')} // Replace with your app logo
        style={styles.logo}
      />
      <Text style={styles.appName}>UrbanFleet</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  header: {
    width: 'auto',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    padding: 10,
    marginBottom: 20,
    //backgroundColor: 'lightblue', // Customize the background color
  },
  logo: {
    width: 40, // Set the desired width for your logo
    height: 40, // Set the desired height for your logo
  },
  appName: {
    fontSize: 20,
    fontWeight: 'bold',
    marginLeft: 10,
  },
});

export default CustomHeader;
